entry.html.body:
Entry
The default entry looks like:
{
  client: ['./src/index.js'],
  // in hot reloading mode, the client entry is:
  // client: ['./src/index.js', '/path/to/webpack-hot-middleware/client'],
  // in production mode
  // you can also use `vendor` option to bundle common dependencies in a single chunk called `vendor` other than `client` chunk
  vendor: undefined
  // eg: set vendor: ['vue', 'vue-router', 'vuex'] in config file
}

When you provide a custom entry in string type, it will update entry.client, it's very handy for single entry application, since all you need is the client entry.
But you can also add multiple entries, just set the entry to an object:
// vue.config.js
export default {
  entry: {
    client: './your/main/entry.js',
    other: './another/entry.js'
  }
}

Don't worry about vendor entry, we'll automatically add it for you.
Also, by default, only the client entry will enable hot-reloading, you can use the hot option to select the entries which need hot-reloading.
// vue.config.js
export default {
  hot: ['client', 'another-chunk']
}

templates.html.body:
Templates
By default, we add a html-template-plugin for you to generate HTML output for all chunks:
// the default plugin for generating html output
new HtmlWebpackPlugin({
  title: options.title || 'vbuild app',
  template: options.template ? _.cwd(options.template) : _.dir('lib/template.html'),
  inject: false,
  minify: {
    removeComments: true,
    collapseWhitespace: true,
    removeAttributeQuotes: true,
    minifyJS: true,
    minifyCSS: true
  },
  ga: options.ga || options.analytics || options.googleAnalytics
})

And you can use title template options to adjust it.

title: The content of  in html output
template: THe path to your custom HTML template

Check out the default template.html we use, it supports the ejs syntax and the html-webpack-plugin options.
The template could also be an object which represents the html-webpack-plugin options.
You may also want to generate other HTML files to exclude or include some chunks, then you can use templates option, it's simply an array of options for html-webpack-plugin, we use it to insert multiple html-webpack-plugin into the webpack config's plugins property, and sure it inherits from the default html-webpack-plugin option we mentioned above:
// vue.config.js
export default {
  title: 'default title',
  templates: [
    {
      // this inherits default title
      chunks: ['some chunk names']
    },
    {
      // the html output has different title
      title: 'app',
      chunks: ['client', 'vendor']
    }
  ]
}

