static-files-like-favicon.html.body:
Static files like favicon
You may need to copy favicon.ico or CNAME file if you're deploying to github pages, you can achieve this by creating a ./static and put these files in it, and you're all set:
./static/favicon.ico ===> ./dist/favicon.ico
./static/CNAME ===> ./dist/CNAME

All the files inside ./static will be copied to the root directory of ./dist or a custom dist path if use --dist option too.
You can also change the folder name you want for static folder, as well as the destination directory of files for static folder.
export default {
  static: {
    // `from` is relative to `./`
    from: 'public',
    // `to` is relative to `./dist`
    to: './'
  }
}

Now everything inside ./public will be copied to './dist'.
You can also use an array as static option to totally override the default one and copy more directories.
export default {
  static: [
    {from: './src/assets', to: './assets'},
    {from: './static', to: './'}
  ]
}

You can find the option definitions at copy-webpack-plugin.

split-vendor-and-app-code.html.body:
Split vendor and app code
By providing vendor option, you can use it to split vendor and app code.
export default {
  vendor: ['vue', 'vuex', 'vue-router']
}

Or if it's considered safe, you can:
export default {
  vendor: Object.keys(require('./package.json').dependencies)
}

preprocessors-in-single-file-component.h.body:
Pre-processors
It's exactly the same way as that in regular Vue project, check out the vue-loader doc for this, for example:
A Sass project:
npm install sass-loader node-sass -D


  $color: red;
  body {color: $color;}


And you're all set!
Autoprefix
No matter what CSS pre-processors you're using, the compiled css (in single file component) will be passed to postcss-loader.
So simply set autoprefixer option in postcss property:
// vue.config.js
export default {
  postcss: {
    autoprefixer: {
      browsers: ['ie > 9', 'chrome > 42']
    }
  }
}

server_bundle.html.body:
Server bundle
You are recommended to use bundleRenderer to bundle app for server-side use, in brief, you need to:

Set webpack target to node, format to cjs
Exclude dependencies from the bundle file

export default {
  target: 'node',
  cjs: true,
  externals: Object.keys(require('./package.json').dependencies)
}

And don't forget to update your server entry:
// server-entry.js 
import Vue from 'vue'
import App from './App.vue'

const app = new Vue(App)

// the default export should be a function 
// which will receive the context of the render call 
export default context => {
  // data pre-fetching 
  return app.fetchServerData(context.url).then(() => {
    return app
  })
}

For complete usage for vue server-side rendering, please refer to the docs.

components.html.body:
Components
Bundle components should be easy, and it is.
export default {
  // umd format
  umd: 'moduleName',
  // cjs format
  // "cjs": true,
  // name of bundled file
  filename: 'my-module',
  // do compress, you can turn it off though
  'compress': true,
  // all dependencies will be included in bundled file
  // to exclude them:
  'externals': ['object-assign'],
  // no source-map, please
  'devtool': false
}

Note: in umd and cjs format, the vendor chunk is always removed, since you are bundling a library, not an app.
